import React from 'react';

const WorkshopDetails = (workshop) => {

        return (
            <div>
                <table>
                <tbody>
                        <tr key={workshop.id}>
                            <td>{workshop.title}</td>
                            <td>{workshop.status_open}</td>
                            <td>{workshop.date}</td>
                            <td>{workshop.description}</td>
                            <td>{workshop.room_id}</td>
                        </tr>
                </tbody>
                </table>

            </div>
        );
}

export default WorkshopDetails;
